import React from "react";
import { Link } from "react-router-dom";

const PlayerCard = ({ player }) => (
  <Link to={`/player/${player?.id}`}>
    <div className="flex flex-col items-center">
      <div className="h-9 w-9 bg-gray-100 rounded-full overflow-hidden flex items-end justify-center">
        <img
          className="h-8"
          alt="playerPhoto"
          src={`https://images.fotmob.com/image_resources/playerimages/${player?.id}.png`}
        />
      </div>
      <div className="text-sm text-gray-100 text-center">
        <span className="font-medium">{player?.shirt}</span> {player?.name?.lastName}
      </div>
    </div>
  </Link>
);

export default PlayerCard;
